void test<T>(Type i) {
  final Type d = T;
  print(d);
  print(T);
  print(i);
  print("${d == i}");
}

@d.Entity()
class Simple {
  int id;
  String text;

  Simple();
  Simple.w(this.id, this.text);

  @override
  String toString() {
    return "$id: $text";
  }
}

@d.Entity()
class Test6 {
  List<Simple> simple;

  Test6();

  @override
  String toString() {
    return simple.fold("Test6: \n", (a, b) => a + b.toString() + "\n");
  }
}

