void testEncoding() {
  List<Test6> l = new List<Test6>();
  for (int i = 0; i < 30000; i++) {
    Test6 t = new Test6();
    t.simple = new List<Simple>();
    t.simple.add(new Simple.w(i, "first $i"));
    t.simple.add(new Simple.w(i + 1, "second $i"));
    t.simple.add(new Simple.w(i + 2, "third $i"));
    l.add(t);
  }
  int its = 30;
  Stopwatch w = new Stopwatch();

  w.reset();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = encode(l);
  }
  w.stop();
  print("encode 2nd version took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = god.serialize(l);
  }
  w.stop();
  print("json god took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  var dson = new d.Dartson.JSON();
  for (int i = 0; i < its; i++) {
    var b = dson.encode(l);
  }
  w.stop();
  print("dartson took: ${w.elapsedMilliseconds}");
}

void testDecoding() {
  int its = 20;
  Stopwatch w = new Stopwatch();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = JSON.decode(list);
  }
  w.stop();
  print("JSON.decode took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = decode<List<Test6>>(list, new List<Test6>().runtimeType);
    //print(b.length);
  }
  w.stop();
  print("decode 3rd version took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = decodeObj<List<Test6>>(
        JSON.decode(list), new List<Test6>().runtimeType);
    //print(b.length);
  }
  w.stop();
  print("decode 2nd version took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  for (int i = 0; i < its; i++) {
    var b = god.deseriaizeJson(list, outputType: new List<Test6>().runtimeType);
    //print(b.length);
  }
  w.stop();
  print("json god took: ${w.elapsedMilliseconds}");

  w.reset();
  w.start();
  var dson = new d.Dartson.JSON();
  for (int i = 0; i < its; i++) {
    var b = dson.decode(list, new Test6(), true);
    //print(b.length);
  }
  w.stop();
  print("dartson took: ${w.elapsedMilliseconds}");
}
